var script_f25_56_26497=[" /* <![CDATA[ */",
"",
"",
"function log(i){",
"return Math.log(i) * Math.LOG10E;   ",
"}",
"",
"function ln(i){",
"return Math.log(i);",
"}",
"",
"function sq(i){",
"return i * i;",
"}",
"",
"function sqr(i){",
"return Math.sqrt(i);",
"}",
"",
"",
"function power(x,y){",
"return Math.pow(x,y);",
"}",
"",
"function eTo(x){",
"return Math.exp(x);",
"}",
"",
"",
"function fixDP(r, dps) {",
"if (isNaN(r)) return \"NaN\";",
"var msign = '';",
"if (r < 0) msign = '-';",
"x = Math.abs(r);",
"if (x > Math.pow(10, 21)) return msign + x.toString();",
"var m = Math.round(x * Math.pow(10, dps)).toString();",
"if (dps == 0) return msign + m;",
"while (m.length <= dps) m = \"0\" + m;",
"return msign + m.substring(0, m.length - dps) + \".\" + m.substring(m.length - dps);",
"}",
"",
"var currenttimeout;",
"",
"",
"var calctxt = ''; ",
"var xmltxt = ''; ",
"var htmtxt = ''; ",
"",
"",
"",
"function SystemicVascRes_fx() {",
"",
"currenttimeout = self.setTimeout('minMaxCheck();', 3000);",
"",
"with(document.SystemicVascRes_form){",
"",
"",
"doCalc = true;",
"if (Mean_Aortic_Pressure_param.value.indexOf(',') >= 0){ Mean_Aortic_Pressure_param.value = ''; doCalc = false; alert('Comma character not allowed'); }",
"param_value = parseFloat(Mean_Aortic_Pressure_param.value);",
"if (isNaN(param_value)){param_value = \"\"; doCalc = false;}",
"unit_parts = Mean_Aortic_Pressure_unit.options[Mean_Aortic_Pressure_unit.selectedIndex].value.split('|');",
"Mean_Aortic_Pressure = param_value * parseFloat(unit_parts[0]) + parseFloat(unit_parts[1]);",
"if (Right_Atrial_Pressure_param.value.indexOf(',') >= 0){ Right_Atrial_Pressure_param.value = ''; doCalc = false; alert('Comma character not allowed'); }",
"param_value = parseFloat(Right_Atrial_Pressure_param.value);",
"if (isNaN(param_value)){param_value = \"\"; doCalc = false;}",
"unit_parts = Right_Atrial_Pressure_unit.options[Right_Atrial_Pressure_unit.selectedIndex].value.split('|');",
"Right_Atrial_Pressure = param_value * parseFloat(unit_parts[0]) + parseFloat(unit_parts[1]);",
"if (Systemic_Flow_param.value.indexOf(',') >= 0){ Systemic_Flow_param.value = ''; doCalc = false; alert('Comma character not allowed'); }",
"param_value = parseFloat(Systemic_Flow_param.value);",
"if (isNaN(param_value)){param_value = \"\"; doCalc = false;}",
"unit_parts = Systemic_Flow_unit.options[Systemic_Flow_unit.selectedIndex].value.split('|');",
"Systemic_Flow = param_value * parseFloat(unit_parts[0]) + parseFloat(unit_parts[1]);",
"dp = 0;",
"SVR =  80 * ( Mean_Aortic_Pressure - Right_Atrial_Pressure) / Systemic_Flow;",
"",
"if (doCalc) SVR_param.value = fixDP(SVR, dp);",
"",
"",
"",
"",
"",
"}",
"",
"}",
"",
"function minMaxCheck(){",
"",
"if (currenttimeout) self.clearTimeout(currenttimeout);",
"",
"with(document.SystemicVascRes_form){",
"",
"",
"",
"}",
"",
"}",
"",
"",
"function clrResults(){",
"",
"if (currenttimeout) self.clearTimeout(currenttimeout);",
"",
"with(document.SystemicVascRes_form){",
"",
"SVR_param.value = '';",
"",
"",
"}",
"",
"}",
"",
"",
"",
"",
"",
"",
"",
"",
"",
"",
"",
"/* ]]> */"].join("\n");
