" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 550px\">",
"   <div class=\"ttl\">",
"    Effect of pegvisomant on serum IGF-1 concentrations",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 530px; height: 332px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Results in 90 patients with acromegaly who were treated with the growth hormone receptor antagonist pegvisomant for 12 to 24 months. The open circles represent the pretreatment values and the closed circles the lowest post-treatment values. The shaded areas represent the normal ranges for age.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: van der Lely, AJ, Hutson, RK, Trainer, PJ, et al. Lancet 2001; 358:1754.",
"    </div>",
