var title_f25_56_26501="ECG strip sinus bradycardia";
var content_f25_56_26501=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F52675&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F52675&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1130px;\">",
"  <div class=\"figure\" style=\"width: 560px\">",
"   <div class=\"ttl\">",
"    Single lead electrocardiogram (ECG) showing sinus bradycardia",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 540px; height: 79px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Marked sinus bradycardia at a rate of 25 to 30 beats/min. The normal P waves (upright in lead II) and PR interval and consistent with a sinus mechanism with normal atrioventricular (AV) conduction.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Ary Goldberger, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Normal rhythm strip",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 165px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Normal rhythm strip in lead II. The PR interval is 0.15 sec and the QRS duration is 0.08 sec. Both the P and T waves are upright.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Morton F Arnsdorf, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
