" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Intracardiac ultrasound examination of a normal mitral valve is shown in diastole and systole",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 202px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Note that individual chordae tendinae are visible and the thin leaflets of the mitral valve.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    ICE mitral stenosis 1",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 180px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Intracardiac ultrasound examination shows a stenotic mitral valve with some leaflet thickening and a hockey-stick appearance of the anterior mitral valve leaflet.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    ICE mitral stenosis 2",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 203px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Intracardiac examination shows a severely deformed mitral valve with extreme thickening of valve leaflets and subvalvular apparatus.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
