" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Morphea and lichen sclerosus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 260px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Sclerotic lesions of morphea with overlying hypopigmented, finely wrinkled skin are present.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Lichen sclerosus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 325px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Oval porcelain-white plaques are present on the trunk of this patient with extragenital lichen sclerosus.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: www.visualdx.com. Copyright Logical Images, Inc.",
"    </div>",
"   </div>",
"  </div>",
