"    Lichen sclerosus - H&amp;E",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Epidermal atrophy, hyperkeratosis, hyalinization of the upper dermis, and a dermal lymphocytic infiltrate are present in this histopathologic specimen from a lesion of lichen sclerosus.",
"    <div class=\"footnotes\">",
"    </div>",
