var title_f25_56_26508="ACC AHA murmurs interventions";
var content_f25_56_26508=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F69748&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F69748&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    ACC/AHA guideline summary: Interventions used to alter the intensity of cardiac murmurs",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Respiration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Right-sided murmurs typically increase with inspiration, while left-sided murmurs generally are louder during expiration.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Valsalva maneuver",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Most murmurs decrease in length and intensity during the Valsalva maneuver. Two exceptions are the systolic murmur of hypertrophic cardiomyopathy (HCM), which usually becomes much louder, and the systolic murmur of mitral valve prolapse (MVP), which becomes longer and often louder. Following release of the Valsalva, right-sided murmurs tend to return to baseline intensity earlier than left-sided murmurs.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Exercise",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Murmurs caused by blood flow across normal or obstructed valves (eg, mitral or pulmonic stenosis) become louder with both isotonic and submaximal isometric (handgrip) exercise. Murmurs of mitral (MR) and aortic regurgitation (AR) and ventricular septal defect (VSD) also increase with handgrip exercise.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Positional changes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Most murmurs diminish with standing due to reduced preload. However, the murmur of HCM becomes louder, and the murmur of MVP lengthens and often is intensified. Similarly, most murmurs become louder with prompt squatting (or usually passive leg raising), while the murmurs of HCM and MVP typically soften and may disappear.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Post ventricular premature beat (VPB) or atrial fibrillation (AF)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Murmurs originating at normal or stenotic semilunar valves increase in intensity during the cardiac cycle following a VPB or in the beat after a long cycle length in AF. In contrast, systolic murmurs due to atrioventricular valve regurgitation do not change, become softer (papillary muscle dysfunction), or become shorter (MVP).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Transient arterial occlusion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Transient external compression of both arms by bilateral cuff inflation to 20 mmHg greater than peak systolic pressure augments the murmurs of MR, VSD, and AR, but not murmurs due to other causes.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     Discussion of amyl nitrate has been removed since the use of amyl nitrate as a provocative agent is no longer recommended.",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from Bonow RO, Carabello BA, Chatterjee K, et al. 2008 Focused update incorporated into the ACC/AHA 2006 guidelines for the management of patients with valvular heart disease. A report of the American College of Cardiology/American Heart Association Task Force on Practice Guidelines (Writing Committee to revise the 1998 guidelines for the management of patients with valvular heart disease). Circulation 2008;118:e523.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
